import styled from "styled-components";

export const LightText = styled.h1`
  font-size: 20px;
  line-height: 22px;
  color: #333333;
`;

export const HeavyText = styled.h1`
  font-weight: bold;
  font-size: 52px;
  line-height: 7px;
  display: flex;
  align-items: center;
`;
